        {
            "uri": "/videos/70573323",
            "name": "Mirror City Timelapse",
            "description": "When I first started Mirror City, I wanted to create a video that was completely out of the norm. I wanted to showcase something unique and artistic, which takes Timelapse photography into a more abstract direction. Mirror City is a visual story through some of the great American cities: Chicago, San Francisco, San Diego, Las Vegas and Los Angeles. These clips were all processed from their original form, into the kaleidoscopic visuals that you see in this video. Many people visit these large cities every day, and all of these places have been shot and filmed, but I wanted to emulate these urban landscapes in a way that nobody has even seen before. I wanted to put man-made geometric shapes, mixed with elements of color and movement to create less of a structured video, and more of a plethora of visual stimulation. \nThe video starts off with simple mirrors and recognizable architecture, as the video progresses, so does the visual stimulation, showing the real abstraction of the piece. \nI have worked on this piece for an extremely long amount of time. I have spent time mirroring images and videos for the past five years, and I have been working on this specific piece for about four months. I felt it was time to combine Timelapse photography and the simplicity of a kaleidoscope, and create Mirror City.\n\nDirected, Filmed & Edited: Michael Shainblum\nwww.shainblumphoto.com/\nwww.facebook.com/shainblumphoto\nwww.500px.com/Shainblum\nwww.twitter.com/shainblum\n\nMusic: Bassnectar\nTrack: Bassnectar – Butterfly (ft. Mimi Page)\nwww.bassnectar.net/\nhttps://itunes.apple.com/us/artist/bassnectar/id2900657\n\nMotion Control Gear Sponsors:\nEmotimo\nwww.emotimo.com/\nDynamic Perception\nwww.dynamicperception.com/\n\n(All clips are available in the original and mirrored format) For licensing & inquires please contact at\nShainblumphoto@gmail.com",
