            "user": {
                "uri": "/users/1958639",
                "name": "Rob Whitworth",
                "link": "https://vimeo.com/robwhitworth",
                "location": "Shanghai",
                "bio": "Rob Whitworth is a prominent urban filmmaker pushing the boundaries of his medium to reveal locations in a powerful and compelling manner. Through the manipulation of time-lapse photography, Rob lifts the constraints of time and space to capture the vibrancy of destinations on a grand scale. Rob’s works are instantly identifiable, with gripping perspectives that create a profoundly transformative experience.\n\nRob’s recent major projects include shoots for Turkish Airlines, Dubai, the upcoming 'One Planet' series for the BBC Natural History Unit, a Facebook video for Nike set in San Francisco, a viral video of Barcelona commissioned by the Catalan tourism board and a short film of Istanbul for Turkish Airlines. His works have gained widespread critical acclaim, and received over 9 million online views on his own Vimeo channel alone. \n\nOriginating from the UK, Robert gained his first-class honours degree in Photography from Norwich School of Art & Design.",
