            "uri": "/videos/10570139",
            "name": "\"The Last 3 Minutes\" Directed by Po Chan",
            "description": "The main character in this short is William Turner, a janitor whose life seems mundane on the surface but as it develops, many interesting layers are revealed. We shot his boring existence in the present day at 24fps utilizing the new Canon 5D firmware.\n\nAs William's life unfolds from present day to the past, we shot with the Canon 5D at 30fps and pulled it in at 24fps to give it a slightly dreamy feel. The creamy Canon 'L' series glass delivered the period look that we were hoping to achieve.\n\nDirector: Po Chan\nCinematographer and Executive Producer: Shane Hurlbut, ASC\nProducer: Greg Haggart\nEditor: Vashi Nedomansky",
