            "name": "Magnitka ver. 4.7",
            "description": "Отснятый в Магнитогорске материал смонтирован в строгом соответствии с последовательностью технологических операций при производстве листовой стали на Магнитогорском металлургическом комбинате - получился серьёзный фильм с глубоким трансцендентным содеражанием.\n\nShot in Magnitogorsk. The footage was edited in precise correspondence with the sequence of technical operations in sheet metal manufacturing at the Magnitogorsk Metallurgical Factory. The result is a serious film with deeply transcendent subject matter.\n\nMusic: \"Totem\" by Klaus Schulze\n\nMore photos: http://fotki.yandex.ru/users/sasha8gb/album/175490",
