            "user": {
                "uri": "/users/3419981",
                "name": "Sasha Aleksandrov",
                "link": "https://vimeo.com/user3419981",
                "location": "Moskow, Russia",
                "bio": "8-916-953-10-39 мобильный\nsasha8gb@yandex.ru , hasdfg@mail.ru\n\nЯ оператор - в смысле оператор цейтраферной камеры (камерамен), цейтраферщик. В качестве цейтраферной камеры использую фотоаппарат Nikon D700. Соответственно, для меня не нужно брать камеру в аренду, что существенно экономит бюджет.\n   Начал снимать цейтраферные кинопланы фотоаппаратом в 1996 году. Первые работы - заставка, несколько перебивок и выходные титры к программе Леонида Парфёнова \"Намедни. Наша эра\" - выход в эфир 1 марта 1997 года. До этого был опыт работы в кино художником-декоратором на фильме Ивана Дыховичного \"Музыка для декабря\" 1995 г. выхода в прокат.\n   В основном, снятые мною планы берут в монтаж документальных фильмов, корпоративных фильмов, другой заказухи, которую массовый зритель, конечно же, не видит. А игровое кино... моего цейтрафера заметное количество в фильмах \"Любовь-морковь 3\", \"Один день\", \"Продавец игрушек\".\n   Для нового сайта по цейтраферной съёмке было записано интервью: http://yadi.sk/d/TYtip7tp8Thos",
